import React, { useEffect, useRef } from 'react';
import styled from 'styled-components';
import * as THREE from 'three';

const TextContainer = styled.div`
  width: 100%;
  height: 100%;
  canvas {
    width: 100% !important;
    height: auto !important;
  }
`;

interface BlotterTextProps {
  text: string;
  size?: number;
  fill?: string;
  className?: string;
}

const vertexShader = `
  varying vec2 vUv;
  void main() {
    vUv = uv;
    gl_Position = projectionMatrix * modelViewMatrix * vec4(position, 1.0);
  }
`;

const fragmentShader = `
  uniform float time;
  uniform float distortionFactor;
  uniform vec2 mousePos;
  uniform vec3 color;
  varying vec2 vUv;

  void main() {
    vec2 uv = vUv;

    // Calculate distance from mouse
    float dist = distance(mousePos, uv);
    float influence = smoothstep(0.5, 0.0, dist) * distortionFactor;

    // Create wave effect
    float wave = sin(uv.x * 10.0 + time) * 0.05 * influence;
    uv.y += wave;

    // Create liquid-like distortion
    float distortion = sin(uv.x * 5.0 + time * 2.0) * cos(uv.y * 5.0 + time) * influence;
    uv += distortion * 0.05;

    // Sharp falloff for text edges
    float alpha = smoothstep(0.5, 0.51, 1.0 - distance(uv, vec2(0.5)));

    gl_FragColor = vec4(color, alpha);
  }
`;

export const BlotterText: React.FC<BlotterTextProps> = ({ 
  text, 
  size = 100,
  fill = '#fff',
  className 
}) => {
  const containerRef = useRef<HTMLDivElement>(null);
  const rendererRef = useRef<THREE.WebGLRenderer | null>(null);
  const sceneRef = useRef<THREE.Scene | null>(null);
  const cameraRef = useRef<THREE.OrthographicCamera | null>(null);
  const materialRef = useRef<THREE.ShaderMaterial | null>(null);
  const mousePos = useRef<{ x: number; y: number }>({ x: 0.5, y: 0.5 });
  const frameRef = useRef<number>();

  useEffect(() => {
    if (!containerRef.current) return;

    // Setup Three.js scene
    const scene = new THREE.Scene();
    sceneRef.current = scene;

    // Setup camera
    const camera = new THREE.OrthographicCamera(-1, 1, 1, -1, 0.1, 10);
    camera.position.z = 1;
    cameraRef.current = camera;

    // Setup renderer
    const renderer = new THREE.WebGLRenderer({ antialias: true, alpha: true });
    renderer.setSize(containerRef.current.clientWidth, containerRef.current.clientHeight);
    rendererRef.current = renderer;

    // Clear container
    while (containerRef.current.firstChild) {
      containerRef.current.removeChild(containerRef.current.firstChild);
    }
    containerRef.current.appendChild(renderer.domElement);

    // Create text texture
    const canvas = document.createElement('canvas');
    const ctx = canvas.getContext('2d');
    if (!ctx) return;

    canvas.width = 512;
    canvas.height = 512;

    ctx.fillStyle = 'black';
    ctx.fillRect(0, 0, canvas.width, canvas.height);

    ctx.fillStyle = 'white';
    ctx.font = `bold ${size}px Creepster`;
    ctx.textAlign = 'center';
    ctx.textBaseline = 'middle';
    ctx.fillText(text, canvas.width / 2, canvas.height / 2);

    const texture = new THREE.CanvasTexture(canvas);

    // Create shader material
    const material = new THREE.ShaderMaterial({
      uniforms: {
        time: { value: 0 },
        distortionFactor: { value: 0 },
        mousePos: { value: new THREE.Vector2(0.5, 0.5) },
        color: { value: new THREE.Color(fill) }
      },
      vertexShader,
      fragmentShader,
      transparent: true
    });
    materialRef.current = material;

    // Create mesh
    const geometry = new THREE.PlaneGeometry(2, 2);
    const mesh = new THREE.Mesh(geometry, material);
    scene.add(mesh);

    // Animation loop
    const animate = () => {
      if (!material || !renderer || !scene || !camera) return;

      material.uniforms.time.value += 0.01;
      material.uniforms.mousePos.value.set(mousePos.current.x, mousePos.current.y);

      renderer.render(scene, camera);
      frameRef.current = requestAnimationFrame(animate);
    };

    frameRef.current = requestAnimationFrame(animate);

    // Handle mouse movement
    const handleMouseMove = (e: MouseEvent) => {
      const rect = containerRef.current?.getBoundingClientRect();
      if (!rect) return;

      mousePos.current = {
        x: (e.clientX - rect.left) / rect.width,
        y: 1 - (e.clientY - rect.top) / rect.height
      };

      if (materialRef.current) {
        const dist = Math.hypot(
          mousePos.current.x - 0.5,
          mousePos.current.y - 0.5
        );
        materialRef.current.uniforms.distortionFactor.value = Math.min(dist * 2, 1);
      }
    };

    window.addEventListener('mousemove', handleMouseMove);

    // Handle resize
    const handleResize = () => {
      if (!containerRef.current || !renderer || !camera) return;

      renderer.setSize(containerRef.current.clientWidth, containerRef.current.clientHeight);
    };

    window.addEventListener('resize', handleResize);

    return () => {
      if (frameRef.current) {
        cancelAnimationFrame(frameRef.current);
      }
      window.removeEventListener('mousemove', handleMouseMove);
      window.removeEventListener('resize', handleResize);
      renderer.dispose();
    };
  }, [text, size, fill]);

  return <TextContainer ref={containerRef} className={className} />;
};
